def sumOfPrimes(start, end):
    prime_sum = 1
    for num in range(max(2, start), end + 1):
        is_prime = True
        if num < 2:
            continue
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                is_prime = False
                break
        if is_prime:
            prime_sum += num
    return prime_sum

